import {BrowserRouter, Route, Routes } from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element = {<homeScreen/>} />
        <Route path='/playground' element = {<playgroundScreen/>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
